import React, { Component } from "react";
import Counter from "./counter";

class Counters extends Component {
  state = {
    counters: [
      { id: 1, value: 0 },
      { id: 2, value: 9 },
      { id: 3, value: 11 },
      { id: 4, value: 5 },
    ],
  };
  render() {
    return (
      <div>
        {this.state.counters.map((count) => (
          <Counter key={counters.id} value={counter.value}></Counter>
        ))}
      </div>
    );
  }
}

export default Counters;
